INSERT INTO avis ("id_objet", "id_user", "date_avis", "note", "commentaire") VALUES (10, 10, TO_DATE('2022-12-23', 'YYYY-MM-DD'), 15, 'Duis bibendum, felis sed interdum venenatis, turpis enim blandit mi, in porttitor pede justo eu massa.');
INSERT INTO avis ("id_objet", "id_user", "date_avis", "note", "commentaire") VALUES (10, 11, TO_DATE('2022-07-12', 'YYYY-MM-DD'), 14, 'Vivamus metus arcu, adipiscing molestie, hendrerit at, vulputate vitae, nisl. Aenean lectus. Pellentesque eget nunc.');
INSERT INTO avis ("id_objet", "id_user", "date_avis", "note", "commentaire") VALUES (10, 14, TO_DATE('2022-11-08', 'YYYY-MM-DD'), 17, 'Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Nulla dapibus dolor vel est. Donec odio justo, sollicitudin ut, suscipit a, feugiat et, eros. Vestibulum ac est lacinia nisi venenatis tristique.');
INSERT INTO avis ("id_objet", "id_user", "date_avis", "note", "commentaire") VALUES (10, 2, TO_DATE('2022-10-01', 'YYYY-MM-DD'), 12, 'Nunc nisl. Duis bibendum, felis sed interdum venenatis, turpis enim blandit mi, in porttitor pede justo eu massa.');
INSERT INTO avis ("id_objet", "id_user", "date_avis", "note", "commentaire") VALUES (10, 5, TO_DATE('2022-08-22', 'YYYY-MM-DD'), 9, 'Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Duis faucibus accumsan odio. Curabitur convallis. Duis consequat dui nec nisi volutpat eleifend.');
INSERT INTO avis ("id_objet", "id_user", "date_avis", "note", "commentaire") VALUES (10, 6, TO_DATE('2022-07-12', 'YYYY-MM-DD'), 8, 'Integer pede justo, lacinia eget, tincidunt eget, tempus vel, pede. Morbi porttitor lorem id ligula. Suspendisse ornare consequat lectus.');
INSERT INTO avis ("id_objet", "id_user", "date_avis", "note", "commentaire") VALUES (10, 9, TO_DATE('2022-08-08', 'YYYY-MM-DD'), 2, 'Quisque id justo sit amet sapien dignissim vestibulum. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Nulla dapibus dolor vel est.');
